import React, { Component } from 'react'
import { Link } from "react-router-dom";


export class Cart extends Component {
    render() {
        return (
            <div>
                <p>Hello World</p>
                <Link to='/'>Homepage</Link>
            </div>
        )
    }
}

export default Cart
